//---------------------------------------------------------------------------
std::string IntToHex(int n)
{
	std::stringstream ss;
	ss << std::hex << n;
	return ss.str();
}
bool MemberOffsetIsRight(std::string typeName, int offset, int correctOffset)
{
	if (offset == correctOffset)
		return true;
#ifdef PRINT_SDK_INFO
	std::string debugInfo;
	debugInfo += "============================== [ UFT ] ==============================\n";
	debugInfo += "(" + typeName + ")\n";
	debugInfo += "[-] Start with wrong offset [0x" + IntToHex(offset) + "].\n";
	debugInfo += "[+] Correct offset is [0x" + IntToHex(correctOffset) + "].\n";
	debugInfo += "=====================================================================\n";

	#ifdef PRINT_IN_CONSOLE
	std::cout << debugInfo.c_str();
	#else
	OutputDebugString(debugInfo.c_str());
	#endif
#endif

	return false;
}
//---------------------------------------------------------------------------
bool InitSdk(const std::string& moduleName, const size_t gObjectsOffset, const size_t gNamesOffset)
{
	auto mBaseAddress = reinterpret_cast<uintptr_t>(GetModuleHandleA(moduleName.c_str()));

	if (mBaseAddress == 0x00)
		return false;
	
	UObject::GObjects = reinterpret_cast<UFT::TUObjectArray*>(mBaseAddress + gObjectsOffset);
	FName::GNames = reinterpret_cast<UFT::GNAME_TYPE*>(mBaseAddress + gNamesOffset);

#ifdef PRINT_SDK_INFO
	std::string notes;
	notes += "[*] Don't forget change MACRO (000 => NNN).\n";
	notes += "[*] If wrong offset is less than the 'Minimum' then check 'Super` members sizes.\n";
	notes += "[*] If you edit any class padding then make sure it's not affect any chiled classes.\n";

	#ifdef PRINT_IN_CONSOLE
	std::cout << notes.c_str();
	#else
	OutputDebugString(notes.c_str());
	#endif

	ClassesMemberAssert();
#endif

	return true;
}
bool InitSdk()
{
	return InitSdk("RocketLeague.exe", 0x23B28F8, 0x23B28B0);
}
